    "48701": {
        "Desc": "Parlez à Margaret.",
        "Talk": [
            [
                {
                    "N": "Venti",
                    "T": "Ce chat était donc à vous..."
                },
                {
                    "N": "_1005",
                    "T": "Venti ! Tu es venu nous aider ?"
                },
                {
                    "N": "Venti",
                    "T": "Vous aider pour quoi ? Au contraire, c'est moi qui ai besoin d'aide !"
                },
                {
                    "N": "_1005",
                    "T": "Ah ? Tu ne parlais pas de Prince avec Margaret ?"
                },
                {
                    "N": "Venti",
                    "T": "C'est donc comme ça qu'il s'appelle... Ce chat m'a volé mes <color=#00E1FFFF>cordes en fer astral</color> !"
                },
                {
                    "N": "Venti",
                    "T": "Même si ça fait plaisir de voir que l'esprit d'initiative cher à Mondstadt vit même à travers ses animaux de compagnie... Il ne manque quand même pas d'air !"
                },
                {
                    "N": "Margaret",
                    "T": "Haha ! Prince est un sacré chenapan, pas vrai ?"
                },
                {
                    "N": "_0",
                    "T": "À qui la faute ?"
                },
                {
                    "N": "_1005",
                    "T": "Vous avez des airs de Barbatos, vous savez..."
                },
                {
                    "N": "Venti",
                    "T": "Hahaha ! Je suis flatté par la comparaison ! Bon, retrouvons Prince."
                },
                {
                    "N": "Venti",
                    "T": "J'ai un spectacle ce soir, et sans mes cordes de rechange pour ma lyre, ça risque d'être tendu..."
                },
                {
                    "N": "_1005",
                    "T": "Pourquoi un chat te volerait des cordes ?"
                },
                {
                    "N": "Margaret",
                    "T": "Tout le monde sait que les chats aiment les baballes !"
                },
                {
                    "N": "_1005",
                    "T": "Hein ?!"
                },
                {
                    "N": "Venti",
                    "T": "Ces cordes ont été fabriquées en fer astral concentré en Anémo. Elles sont assez résistantes, alors je les enroule pour les emporter plus facilement..."
                },
                {
                    "N": "Venti",
                    "T": "C'est une astuce de barde itinérant !"
                },
                {
                    "N": "_1005",
                    "T": "Tes cordes possèdent de l'énergie Anémo, c'est bien ça ?"
                },
                {
                    "N": "_1005",
                    "T": "#Parfait ! {NICKNAME}, c'est l'heure d'utiliser ta <color=#00E1FFFF>vue élémentaire</color> !"
                }
            ]
        ]
    },
